import React from "react";

function SearchPopup() {
  return (
    <div>
      <h3>Search</h3>
      <div>
        <label>Destination</label>
        <input type="text"></input>
      </div>
      <div>
        <label>Check-in Date</label>
        <input type="date"></input>
      </div>
      <div>
        <h3>Options</h3>
      </div>
    </div>
  );
}
export default SearchPopup;
